import './styles.css';

const Navbar = () => {
  return (
    <nav className="navbar bg-primary">
      <div className="container-fluid">
        <a href="link" className="nav-logo-text">
          <h4>Ferreira Lapa</h4>
        </a>
        <div className="collpase navbar-collapse">
          <ul className="navbar-nav">
            <li>
              <a href="link">HOME</a>
            </li>

            
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
